package csd.blr.main.java;

public class Rect {
	
	int w,h;

	public int getW() {
		return w;
	}

	public void setW(int w) {
		this.w = w;
	}

	public int getH() {
		return h;
	}

	public void setH(int h) {
		this.h = h;
	}

	public int area() {
		// TODO Auto-generated method stub
		return this.w*this.h;
	}

	

}
